import React from 'react';


class Case extends React.Component{
  constructor(props) {
    super(props);
  }

  render() {
    return (
      <div className={"rond"} style={"background-color:"+this.props.bg} onClick={this.props.lol}>
      </div>
    );
  }
}

export default Case;
